import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import logo from '../img/logo.svg';
// import '../App.css';

function NavbarTop() {
	return (
		<Navbar style={styles.navBox}>
			<Navbar.Brand>
				<img src={logo} className="App-logo" alt="logo" />
			</Navbar.Brand>
			<Navbar.Brand style={(styles.defaultFontFamily, styles.logoText)}>
				Coffee Quiz
			</Navbar.Brand>
			<Navbar.Toggle />
			<Navbar.Collapse className="justify-content-end">
				<Navbar.Text>
					Signed in as: <a href="#login">Mark Otto</a>
				</Navbar.Text>
			</Navbar.Collapse>
		</Navbar>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	logoText: {
		fontWeight: '700',
		color: '#606f7aff'
	},
	navBox: {
		borderBottom: '2px solid #b7c1cbff'
	}
};

export default NavbarTop;
